window.bookSummaryJSON = "<p>A new day. A new game. A new girl to (try to) please.</p> <p>Issy Grey is a control freak. There’s no problem she can’t solve. Issy’s also a successful self-help author, presenter, and life coach. She has every answer, every time you ask for it.</p> <p>That is...until her BFF butts into her life and signs her up for a sexual-fantasy-fulfillment game she never asked to play!</p> <p>Now she can’t turn it off! She can’t quit because Jordan Wells refuses to admit she’s even a player! And she can’t get rid of the man assigned to pleasure her with panic because he’s her new bodyguard!</p> <p>Just...WTF?</p> <p><i>Includes a special bonus note read by the author.</i></p>"; 
